import * as React from "react";


const Teste = () => {

    return (
    <AsyncSelect
      loadOptions={inputValue =>
        fetch(
          "https://restcountries.eu/rest/v2/name/" +
            inputValue
        )
          .then(data => data.json())
          .then(results =>
            results.map(({ name }) => {
              return { label: name, value: name };
            })
          )
      }
      labelText="Country"
    />
  );
}


export default Teste;
